var express=require('express');
var app=express();

app.set('view engine','ejs');

var bodyParser = require('body-parser');
app.use(bodyParser.urlencoded({ extended: true }));

var camps=[
           {name:'delhi',img:'data:image/jpeg;base64,',desc:'hi how are you'},
           {name:'manali',img:'data:image/jpeg;base64,',desc:'welcome to manali'},
           {name:'shimla',img:'data:image/jpeg;base64,',desc:'hi i am here'}
];

app.get('/',function(req,res)
{
    //res.send("hi how are you");
    res.render("index1");
});

app.get('/main',function(req,res)
{
  res.render('main',{camps:camps});
  
});

app.get('/addnew',function(req,res)
{
  res.render('addnew');
});

app.post('/add',function(req,res)
{
 // console.log(req.body);
  camps.push(req.body);
  res.render('main',{camps:camps});
});

app.listen(process.env.PORT,process.env.IP,function(err)
{
  if(err)
  throw err;

  console.log("yelpcam server has started");
});
